import Product from "../models/product";
import { PRODUCTS_PER_PAGE } from "../config";

const _productDataValidation = ({ name, rowPrice, fullPrice, categoryId }) => {
  if (!name) {
    return {
      valid: false,
      message: "product name is required"
    };
  }

  if (!rowPrice) {
    return {
      valid: false,
      message: "row price is required"
    };
  }

  if (!fullPrice) {
    return {
      valid: false,
      message: "full price is required"
    };
  }

  if (!categoryId) {
    return {
      valid: false,
      message: "category id is required"
    };
  }

  return { valid: true };
};

class ProductsController {
  getProductsByCategory({ params: { categoryId, currentPage } }, res) {
    const filter = categoryId === "ALL_CATEGORIES" ? {} : { categoryId };
    const limit = parseInt(PRODUCTS_PER_PAGE, 10);
    const skip = limit * (currentPage - 1);
    let totalPages = 1;

    Product.count(filter)
      .then(length => {
        totalPages = Math.ceil(length / limit);
      })
      .then(() => {
        Product.find(filter, null, { limit, skip }).then(products => {
          res.status(200).send({
            success: "true",
            message: "products by category retrived successfully",
            products,
            totalPages
          });
        });
      })
      .catch(error => {
        res.status(404).send({
          success: "false",
