    rowPrice: { type: Number, required: true },
    fullPrice: { type: Number, required: true },
    categoryId: { type: String, required: true }
  },
  { collection: "products" }
);

ProductSchema.plugin(autoIncrement.plugin, {
  model: "Product",
  field: "_id",
  startAt: 1
});

module.exports = mongoose.model("Product", ProductSchema);

